Topór is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Mrozy"&gt;Gmina Mrozy&lt;/a&gt;, within &lt;a href="Mi%C5%84sk%20County"&gt;Mińsk County&lt;/a&gt;, &lt;a href="Masovian%20Voivodeship"&gt;Masovian Voivodeship&lt;/a&gt;, in east-central Poland. It lies approximately east of &lt;a href="Mrozy%2C%20Mi%C5%84sk%20County"&gt;Mrozy&lt;/a&gt;, east of &lt;a href="Mi%C5%84sk%20Mazowiecki"&gt;Mińsk Mazowiecki&lt;/a&gt;, and east of &lt;a href="Warsaw"&gt;Warsaw&lt;/a&gt;.
